// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar() {
  return (
    <nav className="navbar custom-navbar navbar-expand-lg">
      <div className="container-fluid d-flex align-items-center justify-content-between">
        {/* Logo */}
        <Link className="navbar-brand d-flex align-items-center" to="/">
          <img
            src="/media/images/logo.svg"
            alt="Logo"
            className="navbar-logo"
          />
          <span className="navbar-title ms-2">SmallTalk2Me</span>
        </Link>

        {/* All center nav items including Sign In */}
        <div className="d-flex gap-4 align-items-center mx-auto">
          <Link className="nav-link fw-bold" to="/product">Products</Link>
          <Link className="nav-link fw-bold" to="/business">For Business</Link>
          <Link className="nav-link fw-bold" to="/schools">For Schools</Link>
          <Link className="nav-link fw-bold" to="/blog">Blog</Link>
          <Link className="nav-link fw-bold" to="/about">About Us</Link>
          <Link to="/signup" className="btn signin-btn">Sign In</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
